import React from "react";
import './Timeline.css'; 

const Timeline = () => {
  return (
    <section className="section-primary" id="timelinesection">
      <div className="container">
        <div className="row">
          <div className="col-md-12 section-heading">
            <h2>Experience</h2>
            <hr className="white" />
          </div>
        </div>
        <div className="row flashcard-grid">
          {[
            {
                title: "Kaylie.AI",
                details: "Developed and maintained a web application for Kaylie.AI, a specialized study tool designed for medical students. Implemented a backend system using MySQL and Python to manage user data and enhance functionality, while also creating an intuitive and responsive user interface using HTML, Tailwind, React, and React Native. Collaborated with stakeholders to ensure the application met the unique needs of medical students.",
                image: "path-to-your-kaylie-ai-image.jpg" // Add your image path here
            },
            {
                title: "Incredible Escape Rooms",
                details: "Developed and managed secure servers for critical data, including security footage and customer contracts. Improved data protection through encryption, firewall setup, and Cloudflare integration. Streamlined document storage, optimizing performance and minimizing downtime.",
                image: "path-to-your-incredible-escape-rooms-image.jpg" // Add your image path here
            },
            {
              title: "Education",
              details: "Arizona State University, Ira A. Fulton School of Engineering\nB.S, Computer Science (Software Engineering) Aug 2023 - May 2027\n- Recipient of Arizona Promise Grant Scholarship\n- New American University Scholar - Dean's Award List",
              image: "path-to-your-education-image.jpg" // Add your image path here
            },
            {
              title: "NurseAssist (SunHacks)",
              description: "Developed a tool to measure blood pressure, temperature, blood oxygen levels, and blood sugar using Raspberry Pi 4, MX30102 and DS18B20 sensors. Utilized Python for backend processing, storing data in a MySQL database accessible to healthcare professionals. Built a responsive website using HTML, CSS, JavaScript, and React, aimed at reducing nurses' workload.",
              link: "https://github.com/Nairinn/Nurse-Assist",
              image: "https://i.pinimg.com/originals/f9/57/6f/f9576fca9fc8ef79976a1d6327bbe9ae.gif",
            },
            {
              title: "MIT Science Bowl Invitational",
              details: "Massachusetts Institute of Technology Science Bowl Invitational\nInvited to compete at the MIT Science Bowl with 3 other teammates.",
              image: "path-to-your-mit-science-bowl-image.jpg" // Add your image path here
            },
            {
              title: "HMMT",
              details: "Harvard-MIT Math Tournament\nInvited to compete at Harvard-MIT Math Tournament, it is one of the largest and most prestigious high school competitions in the world.",
              image: "path-to-your-hmmt-image.jpg" // Add your image path here
            },
          ].map((item, index) => (
            <div className="flashcard" key={index}>
              <div className="flashcard-image">
                <img src={item.image} alt={item.title} className="project-image" /> {/* Displaying the image */}
              </div>
              <div className="flashcard-content">
                <h3>{item.title}</h3>
                <p>{item.details.split('\n').map((line, i) => <span key={i}>{line}<br /></span>)}</p>
              </div>
            </div>
          ))}
        </div>
        <p className="lead" style={{ textAlign: 'center' }}>
          <a 
              href="path-to-your-resume.pdf" 
              download="YourResume.pdf" 
              className="resume-download"
          >
              Resume
          </a>
        </p>
      </div>
    </section>
  );
};

export default Timeline;
